import React from 'react';
import Routes from "./Routes.js"
import AuthenticatedUserProvider from "./contexts/AuthenticatedUser.js";

function App() {
  return (
    <AuthenticatedUserProvider>
      <div style={{ backgroundColor: '#96A5AB', width: '100%', height: '100%' }}>
        <Routes />
      </div>

    </AuthenticatedUserProvider>
  );
}

export default App;
